名称：<br>
超激安！そのうえ送料無料！<br>
ケース販売 ガーデンシクラメン<br>

<br>

<br><br>
商品説明：<br>
ケース販売 ガーデンシクラメン<br>
1ケース　3号ポット 24ポット入り
<br><br>
サイズ：<br>
3号ポット<br><br>
最大販売可能数：<br>
４ケース限定<br><br>
特徴：<br>
耐寒性に優れたガーデニング、寄植えに最適なガーデンシクラメンの格安販売です。シーズン最盛期より、かなりお求めやすい価格になりました。
ラベルは付いていませんが、商品はもちろん、生産者は長野県の菊池洋史ですからご安心してご購入ください。
<br><br>
注意事項：<br>
<br>
お花の原体ですので、クール便や遠隔地へのお届けは出来ません。
<br>
